that%20specifies%20the%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20index%20values%20of%20the%20removed%20items.%20The%20indices%20must%20be%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20in%20sorted%20order%2C%20from%20lowest%20to%20highest%24%24children%20-%20an%20array%20of%20Object%20containing%20the%20inserted%2C%20removed%2C%20or%0A%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20%20changed%20objects%24%24See%20Also%3A%24%24TreePath','null','null','Used%20to%20create%20an%20event%20when%20nodes%20have%20been%20changed%2C%20inserted%2C%20or%20%20removed%2C%20identifying%20the%20path%20to%20the%20parent%20of%20the%20modified%20items%20as%20%20an%20array%20of%20Objects.%20All%20of%20the%20modified%20objects%20are%20siblings%20which%20are%20%20direct%20descendents%20%28not%20grandchildren%29%20of%20the%20specified%20parent.%20%20The%20positions%20at%20which%20the%20inserts%2C%20deletes%2C%20or%20changes%20occurred%20are%20%20specified%20by%20an%20array%20of%20int.%20The%20indexes%20in%20that%20array%20%20must%20be%20in%20order%2C%20from%20lowest%20to%20highest.%20%20%20%20For%20changes%2C%20the%20indexes%20in%20the%20model%20correspond%20exactly%20to%20the%20indexes%20%20of%20items%20currently%20displayed%20in%20the%20UI.%20As%20a%20result%2C%20it%20is%20not%20really%20%20critical%20if%20the%20indexes%20are%20not%20in%20their%20exact%20order.%20But%20after%20multiple%20%20inserts%20or%20deletes%2C%20the%20items%20currently%20in%20the%20UI%20no%20longer%20correspond%20%20to%20the%20items%20in%20the%20model.%20It%20is%20therefore%20critical%20to%20specify%20the%20%20indexes%20properly%20for%20inserts%20and%20deletes.%20%20%20%20For%20inserts%2C%20the%20indexes%20represent%20the%20final%20state%20of%20the%20tree%2C%20%20after%20the%20inserts%20have%20occurred.%20Since%20the%20indexes%20must%20be%20specified%20in%20%20order%2C%20the%20most%20natural%20processing%20methodology%20is%20to%20do%20the%20inserts%20%20starting%20at%20the%20lowest%20index%20and%20working%20towards%20the%20highest.%20Accumulate%20%20a%20Vector%20of%20Integer%20objects%20that%20specify%20the%20%20insert-locations%20as%20you%20go%2C%20then%20convert%20the%20Vector%20to%20an%20%20array%20of%20int%20to%20create%20the%20event.%20When%20the%20postition-index%20%20equals%20zero%2C%20the%20node%20is%20inserted%20at%20the%20beginning%20of%20the%20list.%20When%20the%20%20position%20index%20equals%20the%20size%20of%20the%20list%2C%20the%20node%20is%20%22inserted%22%20at%20%20%28appended%20to%29%20the%20end%20of%20the%20list.%20%20%20%20For%20deletes%2C%20the%20indexes%20represent%20the%20initial%20state%20of%20the%20tree%2C%20%20before%20the%20deletes%20have%20occurred.%20Since%20the%20indexes%20must%20be%20specified%20in%20%20order%2C%20the%20most%20natural%20processing%20methodology%20is%20to%20use%20a%20delete-counter.%20%20Start%20by%20initializing%20the%20counter%20to%20zero%20and%20start%20work%20through%20the%20%20list%20from%20lowest%20to%20highest.%20Every%20time%20you%20do%20a%20delete%2C%20add%20the%20current%20%20value%20of%20the%20delete-counter%20to%20the%20index-position%20where%20the%20delete%20occurred%2C%20%20and%20append%20the%20result%20to%20a%20Vector%20of%20delete-locations%2C%20using%20%20addElement%28%29.%20Then%20increment%20the%20delete-counter.%20The%20index%20%20positions%20stored%20in%20the%20Vector%20therefore%20reflect%20the%20effects%20of%20all%20previous%20%20deletes%2C%20so%20they%20represent%20each%20object%27s%20position%20in%20the%20initial%20tree.%20%20%28You%20could%20also%20start%20at%20the%20highest%20index%20and%20working%20back%20towards%20the%20%20lowest%2C%20accumulating%20a%20Vector%20of%20delete-locations%20as%20you%20go%20using%20the%20%20insertElementAt%28Integer%2C%200%29.%29%20However%20you%20produce%20the%20Vector%20%20of%20initial-positions%2C%20you%20then%20need%20to%20convert%20the%20Vector%20of%20Integer%20%20objects%20to%20an%20array%20of%20int%20to%20create%20the%20event.%20%20%20%20Notes%3A%20%20Like%20the